  let r = length(in.localUV); // 0 at center
  let soft = smoothstep(1.0, 0.0, r);
  let core = smoothstep(0.35, 0.0, r);  // brighter core

  // base color: cool blue-ish, but you can bias per-scene
  let base = vec3<f32>(0.15, 0.25, 0.6);
